//logo矩阵
var polaris = [[]];


// 随机取整
function random(min, max) {
    if (arguments.length < 2) {
        max = min;
        min = 0;
    }

    if (min > max) {
        var hold = max;
        max = min;
        min = hold;
    }

    return Math.floor(Math.random() * (max - min + 1)) + min;
}

function shift(x) {
    var max = 0.25,
	flag = Math.random(),
	result;
	if(flag>=0.5)result = x+Math.random()*max;
	else result = x-Math.random()*max;
 
    return result;
    //让星星在一定程度上进行偏移，
}

var Star = function(x,y,radius,limitation,flag) {
	this.x = x; 
	this.y = y;
	this.flag=flag;
    this.radius = radius+Math.random()*limitation;      //星星半径
    this.alpha = Math.random();
    count++;
    stars[count] = this;
}

Star.prototype.draw = function() {
    var x = shift(this.x),
    y = shift(this.y),
    twinkle = random(10);

    if (twinkle === 1||twinkle === 2||twinkle === 3 && this.alpha > 0) {
        this.alpha -= 0.05;
    } else if (twinkle === 6||twinkle === 7||twinkle === 8  && this.alpha < 1) {
        this.alpha += 0.05;
    }

    ctx.globalAlpha = this.alpha;
    ctx.drawImage(canvas2, x - this.radius / 2, y - this.radius / 2, this.radius, this.radius);
}
//暗星
for (var i = 0; i < maxStars; i++) {
    new Star(random(0,w),random(0,h),3,3,0);
}
//亮星
for (var i = 0; i < 520; i++) {
    new Star(random(0,w),random(0,h),10,10,0);
}
// yolk_man
var startX = w/3,
probability=0.3,
startY = h/8,
sum=0;
let startPoint=[],
endPoint=[],
point;


//yolk_man
for (var i=0;i<bella.length;i++){
	for(var j=0;j<bella[i].length;j++){
		if(bella[i][j]==="1"&&Math.random()<probability){
			point = new Array(2);
			point[0] = random(0,w);
			point[1] = random(0,h)
			startPoint[sum] = point;
			new Star(point[0],point[1],4,7,1);
			point = new Array(2);
			point[0] = startX+j*1.5;
			point[1] = startY+i*1.5;
			endPoint[sum] = point;
			sum++;
		}
	}
}

//logo
for (var i=0;i<polaris.length;i++){
	for(var j=1;j<polaris[i].length;j++){
		if(polaris[i][j]==="1")new Star(w/2+j*1.5,startY+i*1.5,20,0,0);
	}
}
var times=107,sumTimes=107;

function sleep(delay) {
    var start = (new Date()).getTime();
    while ((new Date()).getTime() - start < delay) {
      continue;
    }
  }

 
function animation() {
	ctx.globalCompositeOperation = 'source-over';
    ctx.globalAlpha = 0.5;                                 //尾巴
    ctx.fillStyle = 'hsla(' + hue + ', 64%, 6%, 2)';
    ctx.fillRect(0, 0, w, h);
    ctx.globalCompositeOperation = 'lighter';
	sum=0;
    if(times==100){
        sleep(4000);
    }
    for (var i = 1,l = stars.length; i < l; i++) {
		if(stars[i].flag===1&& times>0&&times<=100){
			stars[i].x = startPoint[sum][0]+(sumTimes+1-times)*(endPoint[sum][0]-startPoint[sum][0])/sumTimes;
			stars[i].y = startPoint[sum][1]+(sumTimes+1-times)*(endPoint[sum][1]-startPoint[sum][1])/sumTimes;
			sum++
		}
        stars[i].draw();
    };
	times--;
    window.requestAnimationFrame(animation);
	
}


animation();